    .then((res) => {
      dispatch({
        type: ADD_ANALYSIS,
        payload: res.data,
      });
    })
    .catch((err) => {
      console.log("Error", err);
      if (err) {
        toast.error("Analysis was not added plz check the details", {
          position: "top-right",
          autoClose: 2000,
        });
      }
    });
};



